#include "reimpl2.h"
#include <stdio.h>
#include <stdlib.h>

#define NUMROUNDS (1 << 24)

void decrypt(int *data, int *dest, int len, int k1, int k2) {
  int i;
  for (i = 0; i < len; i++) {
    int txt = data[i];
    int l, r;
    l = (txt >> 12) & ((1 << 12) - 1);
    r = txt & ((1 << 12) - 1);
    int x;
    for (x = 0; x < NUMROUNDS; x++) {
        int r0 = l;
        int r1 = sboxInv2[ l ^ r  ] ^ k2;
        int l0 = r1 ^ sbox1[r0 ^ k1];
        l = l0; r = r0; 
    }
    dest[i] = (l << 12) | r;
  }
}

void encrypt(int *data, int *dest, int len, int k1, int k2) {
  int i;
  for (i = 0; i < len; i++) {
    int txt = data[i];
    int l, r;
    l = (txt >> 12) & ((1 << 12) - 1);
    r = txt & ((1 << 12) - 1);
    int x = 0;
    for (x = 0; x < NUMROUNDS; x++) {
        int l1 = r;
        int r1 = l ^ sbox1[k1 ^ r];
        int r2 = r ^ sbox2[k2 ^ r1];
        l = l1; r = r2;  
    }
    dest[i] = (l << 12) | r;
  }
}

int main(int argc, const char **argv) {
  int k1 = atoi(argv[1]);
  int k2 = atoi(argv[2]);
  int len = 0;
  scanf("%d", &len);
  int *pool = malloc(sizeof(int) * len);
  int *outpool = malloc(sizeof(int) * len);
  int i;
  for (i = 0; i < len; i++)
    scanf("%d", &pool[i]);
  decrypt(pool, outpool, len, k1, k2);
  for (i = 0; i < len; i++)
    printf("%06x", outpool[i]);
  puts("");
  return 0;
}


